1 : Bioturbations (possiblement Planolites) ;
2 : Niveaux argileux ;
3 : Laminations entrecroisées gréseuses ;
4 : Laminations parallèles gréseuses ;
A-B-C-D : Séquences successives de dépôts gréseux à silto-argileux. 
Le sommet de chaque séquence est marqué par des bioturbations, montrant le développement de la vie sous-marine avant que n'arrive un nouvel apport de sédiments. 
Dans chaque séquence la granulométrie décroit progressivement vers le haut (de sableuse à silteuse, voire argileuse).

Lieu : Baie Maa, Nouvelle-Calédonie.
